import React from 'react';
import { useParams,Link  } from 'react-router-dom';
import tourData from '../DB/Tuscany.json';
import BookingDetails from './Purchase/BookingDetails';
import ProgressBar from '../components/ProgressBar';
import Arrows from '../components/Carousel/Arrow';

export default function SpecificTour() {
  const { id } = useParams(); 



  const tour = tourData.find((tour) => tour.id === parseInt(id));

  
  return (
    <section className='specificTour_main_container'>
      <section className="tour" key={tour.id}>
        <h2>{tour.title}</h2> 
        <p> from </p> <p><strong>Price:</strong> {tour.price} â‚¬</p>
      <section>

      </section>
<MainGallery/>
        <p>{tour.short_description}</p>
        <section>
        {/* <Datepicker/>
        <TimePicker/> */}
        {/* <Link to={<BookingDetails/>}>
        <button> Buy Now</button>
        </Link>
         */}
<ProgressBar/>
       <h3>Details</h3>
        <p>{tourData.details}</p>
        <img/> <h3> Number of group: {tour.people}</h3>
        <img/> <h3><strong>Duration:</strong> {tour.duration}</h3>   
        <img/> <h3> Departuring and arriving areas: {tour.departure}</h3>
        <img/> <h3> Guide service:{tour.guide}</h3>
        <img/> <h3>Language:{tour.language}</h3>
        <img/> <h3>Entry Fees:{tour.fees} </h3>
        <img/>  <h3> EntryTransportation:{tour.transport}</h3>
      </section>

      </section>
<GalleryPlaces/>
   
    </section>
  );
}

export const GalleryPlaces = () => {
  const { id } = useParams(); 

    const gallery = tourData.find((gallery) => gallery.id === parseInt(id));
const { img1, img2, img3, img4 } = gallery;


return(
 
  <section  >
    <section className='carousel_header'>
        <h3>Gallery</h3>
<Arrows/>
    </section>
  
     <section className='carousel_container' key={gallery.id}> 
      <img className='carousel_item large' src={gallery.img4} alt="place's image 1" />
      <img  className='carousel_item top-small'src={gallery.img5} alt="place's image 2" />
      <img className='carousel_item  bottom-small' src={gallery.img6} alt="place's image 3" />
      <img className='carousel_item full' src={gallery.img7} alt="place's image 4" />
    </section>
  </section>
   
  
)
}

export const MainGallery = () => {
  const { id } = useParams(); 

  const gallery = tourData.find((gallery) => gallery.id === parseInt(id));
  return(
    
    <section className='main_gallery' key={gallery.id}>
      <img  className='main_gallery-first' src={gallery.img}/>
      <img className='main_gallery-second' src={gallery.img1} />
      <img className='main_gallery-third' src={gallery.img2} />
      <img src={gallery.img3} />
    </section>

  )
}
